export namespace ApiRoutes 
{
    const server: string = '';
    
    export class Account 
    {
        public static Accounts = `${server}/`
        public static Signup = `${this.Accounts}/`;
        public static Signin = `${this.Accounts}/`;
        public static Roles = `${this.Accounts}/roles`;
        public static AdminRole = `${this.Roles}/administrator`;
    }

}
